import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "./FarmerDashboard.css";

const FarmerDashboard = ({ user, logout }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/farmer/login", { replace: true });
    window.location.reload();
  };

  return (
    <div className="farmer-dashboard">

      {/* HEADER / NAVBAR */}
      <nav className="navbar">
        <div className="nav-brand">üåæ Product Tracking using Blockchain</div>
        <div className="nav-links">
          <span className="welcome">Welcome, {user?.name}</span>
          <button onClick={handleLogout} className="logout-btn">LOGOUT</button>
        </div>
      </nav>

      {/* MAIN DASHBOARD */}
      <div className="dashboard">
        <div className="dashboard-header">
          <h1>Farmer Dashboard</h1>
          <p>Manage your products, orders, transportation, and earnings</p>
        </div>

        {/* ACTION CARDS */}
        <div className="dashboard-actions">
          <div className="action-cards">

            {/* Add Product */}
            <Link to="/farmer/add-product" className="action-card">
              <div className="card-icon">‚ûï</div>
              <h3>Add New Product</h3>
              <p>Add a fresh product to your inventory</p>
            </Link>

            {/* View Products */}
            <Link to="/farmer/products" className="action-card">
              <div className="card-icon">üì¶</div>
              <h3>View Products</h3>
              <p>View & manage all your listed products</p>
            </Link>

            {/* View Orders */}
            <Link to="/farmer/orders" className="action-card">
              <div className="card-icon">üßæ</div>
              <h3>Manage Orders</h3>
              <p>See retailer orders & mark them ready</p>
            </Link>

            {/* Assign Transport */}
            <Link to="/farmer/assign-transport-list" className="action-card">
              <div className="card-icon">üöö</div>
              <h3>Assign Transport</h3>
              <p>Assign transporters to deliver products</p>
            </Link>

            {/* Delivery Tracking */}
            <Link to="/farmer/delivery-tracking" className="action-card">
              <div className="card-icon">üìç</div>
              <h3>Track Deliveries</h3>
              <p>Track transporter delivery status</p>
            </Link>

            {/* Earnings */}
            <Link to="/farmer/earnings" className="action-card">
              <div className="card-icon">üí∞</div>
              <h3>My Earnings</h3>
              <p>View revenue generated from products</p>
            </Link>

            {/* Analytics */}
            <Link to="/farmer/analytics" className="action-card">
              <div className="card-icon">üìä</div>
              <h3>Product Analytics</h3>
              <p>Track most sold products & performance</p>
            </Link>

            {/* Profile */}
            <Link to="/farmer/profile" className="action-card">
              <div className="card-icon">üë§</div>
              <h3>My Profile</h3>
              <p>Update your farmer profile details</p>
            </Link>

          </div>
        </div>
      </div>
    </div>
  );
};

export default FarmerDashboard;
